window.bookSummaryJSON = "<p>Accept the unexpected…</p> <p>With her great-aunt in a coma and the rest of the family spiraling out of control as they fight to hold onto their wealth and reputation, the last thing Suri Donovan needs is to be inextricably drawn to this man who's unlike anyone she’s ever met.</p> <p>Break all the rules…</p> <p>She’s related to one of his closest friends. She’s involved in his biggest crime-syndicate case. And she despises him. So why can’t he get through one night without dreaming of the sexy little spitfire? Why can’t he stop wanting her…needing her, like he needs air? Special Agent Pierce Rawlings may not have all the answers, but when Suri goes missing, he’ll move heaven and earth to get her back.</p>"; 
